import React, { useState } from 'react';

function Profile() {
  const [isEditing, setIsEditing] = useState(false);
  const [profile, setProfile] = useState({
    name: 'Likithasri',
    email: 'user@example.com',
    phone: '+91-XXXXXXXXXX',
    membership: 'Verified 🛡️'
  });

  const handleChange = (e) => {
    setProfile({ ...profile, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you would connect to your API
    console.log('Profile updated:', profile);
    setIsEditing(false);
  };

  return (
    <div className="space-y-4">
      <h2 className="text-2xl font-bold text-blue-600 dark:text-blue-300">👤 My Profile</h2>

      {isEditing ? (
        <form onSubmit={handleSubmit} className="bg-gray-100 dark:bg-gray-800 p-4 rounded shadow space-y-3">
          <input type="text" name="name" value={profile.name} onChange={handleChange} className="w-full p-2 rounded" />
          <input type="email" name="email" value={profile.email} onChange={handleChange} className="w-full p-2 rounded" />
          <input type="text" name="phone" value={profile.phone} onChange={handleChange} className="w-full p-2 rounded" />
          <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded">Save</button>
        </form>
      ) : (
        <div className="bg-gray-100 dark:bg-gray-800 p-4 rounded shadow">
          <p className="text-lg font-semibold mb-2">Name: {profile.name}</p>
          <p>Email: {profile.email}</p>
          <p>Phone: {profile.phone}</p>
          <p>Membership: {profile.membership}</p>
          <button onClick={() => setIsEditing(true)} className="mt-4 bg-gray-700 text-white px-4 py-2 rounded">
            Edit Profile
          </button>
        </div>
      )}

      <div className="mt-6">
        <h3 className="text-xl font-semibold text-blue-500 dark:text-blue-400">Recent Activity</h3>
        <ul className="list-disc ml-6 mt-2 text-gray-700 dark:text-gray-300">
          <li>Booked Royal Enfield Classic in Hyderabad (Aug 5)</li>
          <li>Uploaded RC documents for rental approval</li>
        </ul>
      </div>
    </div>
  );
}

export default Profile;
